import React from "react";

import { Helmet } from "react-helmet";

import { Row, Col, Jumbotron } from "react-bootstrap";

const ProfilePage = () => {
  const aboutPageTitle = "About/Amirreza Ghanei";

  return (
    <Row className="justify-content-center mt-5">
      <Helmet>
        <title>{aboutPageTitle}</title>
      </Helmet>
      <Col className="mb-5">
        <Jumbotron fluid={true} className="mt-5">
          <h3 className="ml-5">Hello, world!</h3>
          <Row className="justify-content-around mt-5">
            <p>
              This is a simple hero unit, a simple jumbotron-style component for
              calling
            </p>
            <p>This is a simple hero unit, a simple jumbotron-style component for
              calling</p>
          </Row>
        </Jumbotron>
      </Col>
    </Row>
  );
};

export default ProfilePage;
